import React from 'react';
import '../../App.css';
import Footer from '../Footer/Footer';
import Profile from '../Profile/Profile';

class Statistiques extends React.Component {
  render(){
    return (
      <>
        <Profile />
        <Footer />
      </>
    )
  }
}

export default Statistiques;
